"  </div>",
"  <div id=\"topicText\">",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"mobipreview.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F205145\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      Dental Gases",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F205137\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Children and Adults: Average rate of 2 L/minute",
"    </p>",
"   </div>",
"   <div class=\"block dop drugH1Div\" id=\"F205140\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Pediatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block doe drugH1Div\" id=\"F205138\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Geriatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F205132\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Excipient information presented when available (limited, particularly for generics); consult specific product labeling.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Liquid system with large reservoir holding 75-100 lb of liquid oxygen; compressed gas system consisting of high-pressure tank; tank sizes are &ldquo;H&rdquo; (6900 L of oxygen), &ldquo;E&rdquo; (622 L of oxygen) and &ldquo;D&rdquo; (356 L of oxygen)",
"    </p>",
"   </div>",
"   <div class=\"block geq drugH1Div\" id=\"F205121\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Generic Equivalent Available: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Yes",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F205133\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Treatment of various clinical disorders, both respiratory and nonrespiratory; relief of arterial hypoxia and secondary complications; treatment of pulmonary hypertension, polycythemia secondary to hypoxemia, chronic disease states complicated by anemia, cancer, migraine headaches, coronary artery disease, seizure disorders, sickle-cell crisis, and sleep apnea",
"    </p>",
"   </div>",
"   <div class=\"block ars drugH1Div\" id=\"F205143\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Adverse Reactions Significant",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     No data reported",
"    </p>",
"   </div>",
"   <div class=\"block coi drugH1Div\" id=\"F205135\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Contraindications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     No data reported",
"    </p>",
"   </div>",
"   <div class=\"block war drugH1Div\" id=\"F205125\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Warnings/Precautions",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      <i>",
"       Concerns related to adverse effects:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     &bull; Hypoventilation: Oxygen-induced hypoventilation is the greatest potential hazard of oxygen therapy. In patients with severe COPD, the respiratory drive results from hypoxic stimulation of the carotid chemoreceptors. If this hypoxic drive is diminished by excessive oxygen therapy, hypoventilation may occur and further carbon dioxide retention with possible cessation of ventilation.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     &bull; Pulmonary fibrosis: Extended exposure to higher O",
"     <sub>",
"      2",
"     </sub>",
"     concentrations has been associated with pulmonary fibrosis.",
"    </p>",
"   </div>",
"   <div class=\"block dri drugH1Div\" id=\"F205129\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Drug Interactions",
"    </span>",
"    <br/>",
"    <br/>",
"    <div class=\"lexi\" id=\"lexiInteractAddInfo\">",
"     (For additional information:",
"     <a class=\"dip\" href=\"./drug-interaction\" target=\"_blank\">",
"      Launch Lexi-Interact&trade; Drug Interactions Program",
"     </a>",
"     )",
"    </div>",
"    <div class=\"lexi\" id=\"lexiInteractImgB\">",
"     <img border=\"0\" height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"    </div>",
"    <div class=\"clear\">",
"    </div>",
"    <p style=\"text-indent:0em;display:inline\">",
"     No data reported",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F4297247\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Oxygenium (PL)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F205124\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Increased oxygen in tidal volume and oxygenation of tissues at molecular level",
"    </p>",
"   </div>",
