"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H1676132931\">",
"      <span class=\"h1\">",
"       What is the pituitary gland?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The pituitary gland is a small organ that is found at the base of the brain (",
"      <a class=\"graphic graphic_figure graphicRef72262 \" href=\"mobipreview.htm?38/36/39503\">",
"       figure 1",
"      </a>",
"      ). It is called the &ldquo;master gland&rdquo; because it controls all the other glands in the body.",
"     </p>",
"     <p>",
"      The pituitary gland makes many different hormones. Hormones are chemical messengers that turn on and off different processes in the body. Here is a list of some of the hormones made by the pituitary gland and an explanation of what those hormones do:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Adrenocorticotropic hormone (called &ldquo;ACTH&rdquo;) &ndash; ACTH tells the adrenal glands to release a hormone called cortisol. Cortisol helps control how the body uses sugar (",
"        <a class=\"graphic graphic_figure graphicRef67279 \" href=\"mobipreview.htm?26/50/27424\">",
"         figure 2",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        Thyroid-stimulating hormone (called &ldquo;TSH&rdquo;) &ndash; TSH tells the thyroid gland to release hormones called &ldquo;T3&rdquo; and &ldquo;T4.&rdquo; These hormones control how the body uses and stores energy (",
"        <a class=\"graphic graphic_figure graphicRef66834 \" href=\"mobipreview.htm?14/43/15024\">",
"         figure 3",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        Gonadotropins &ndash; In women, gonadotropins tell the ovaries to release the hormones estrogen and progesterone. They also tell the ovaries to prepare and release eggs. In men, these hormones tell the testicles to make testosterone and sperm.",
"       </li>",
"       <li>",
"        Growth hormone &ndash; Growth hormone helps children grow to a normal height. In adults, it helps keep the right balance of fat and muscle in the body.",
"       </li>",
"       <li>",
"        Prolactin &ndash; Prolactin helps control the development of breasts in girls. It also tells the breasts to make milk after a woman gives birth.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1676133084\">",
"      <span class=\"h1\">",
"       What is panhypopituitarism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Panhypopituitarism is the medical term for when the pituitary gland does not make enough of the hormones it is supposed to make. This can happen when the pituitary gland is damaged. The pituitary gland can be damaged by abnormal growths that sometimes form on the gland. Or it can be damaged by the treatment used to control those abnormal growths.",
"     </p>",
"     <p>",
"      When the pituitary gland does not make enough of its hormones, the other glands that the pituitary gland controls also do not make enough of the hormones they are supposed to make. This can cause serious problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1676133099\">",
"      <span class=\"h1\">",
"       What are the symptoms of panhypopituitarism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms are different, depending on which hormones are most affected by the disorder. In general, the symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Feeling tired",
"       </li>",
"       <li>",
"        Losing weight",
"       </li>",
"       <li>",
"        Being bothered by the cold",
"       </li>",
"       <li>",
"        Decreased appetite",
"       </li>",
"       <li>",
"        Having less interest in sex",
"       </li>",
"       <li>",
"        Having trouble getting pregnant or getting a woman pregnant (called infertility)",
"       </li>",
"       <li>",
"        In women:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Hot flashes",
"       </li>",
"       <li>",
"        Irregular or missed periods",
"       </li>",
"       <li>",
"        Loss of pubic hair",
"       </li>",
"       <li>",
"        Being unable to make milk for breast-feeding",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        In men:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Decreased facial or body hair",
"       </li>",
"       <li>",
"        Testicles that have shrunk",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        In children:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Being shorter than other children of the same age",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1676133115\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes, if your doctor suspects you have panhypopituitarism, you will need blood tests to check for different hormone levels. You might also need an imaging test, such as an MRI. These tests can create a picture of the inside of your body. They can show if there is something pressing on or damaging your pituitary gland.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1676133130\">",
"      <span class=\"h1\">",
"       How is panhypopituitarism treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment usually involves taking hormone medicines to replace the hormones the body is missing. People who are treated for panhypopituitarism usually must take these medicines for the rest of their life. Often, they also need to have regular blood tests to check their hormone levels.",
"     </p>",
"     <p>",
"      People who have a tumor or growth on their pituitary gland, might also need surgery or other treatments (such as radiation therapy) to remove or destroy the tumor or growth.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1676133145\">",
"      <span class=\"h1\">",
"       What if I want to have children?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you want to have children, mention that to your doctor or nurse. Parts of your treatment might need to be different while you are trying to have a baby. For example, you might need to get treated with certain hormones that make it possible for a woman to get pregnant and for a man to make a woman pregnant. With the right treatment, most men and women with panhypopituitarism can have children.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1676133160\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
