"      Moditen (AE, BH, CZ, IQ, KW, OM, QA, SA, VE, YE);",
"     </li>",
"     <li>",
"      Moditen Depot (BG, HN);",
"     </li>",
"     <li>",
"      Monasan (MY);",
"     </li>",
"     <li>",
"      Omca (DE);",
"     </li>",
"     <li>",
"      Pharnazine (TH);",
"     </li>",
"     <li>",
"      Prolixin-D (CO);",
"     </li>",
"     <li>",
"      Sikzonoate (ID);",
"     </li>",
