"      Siqualone (DK, FI, NO, SE)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F172908\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Fluphenazine is a piperazine phenothiazine antipsychotic which blocks postsynaptic mesolimbic dopaminergic D",
"     <sub>",
"      1",
"     </sub>",
"     and D",
"     <sub>",
"      2",
"     </sub>",
"     receptors in the brain; depresses the release of hypothalamic and hypophyseal hormones; believed to depress the reticular activating system, thus affecting basal metabolism, body temperature, wakefulness, vasomotor tone, and emesis",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F172927\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: Decanoate: 24-72 hours;",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Peak effect: Neuroleptic: Decanoate: 48-96 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: Hydrochloride salt: 6-8 hours; Decanoate: ~4 weeks",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Oral: Erratic and variable",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination (derivative dependent): Hydrochloride: ~14-16.4 hours; Decanoate: ~14 days",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum: Hydrochloride: Oral: 2 hours; Decanoate: 8-10 hours",
"    </p>",
"   </div>",
