var title_f37_10_38058="EP study tracings AVRT concealed pathway";
var content_f37_10_38058=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F53644%7ECARD%2F73297%7ECARD%2F65587&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F53644%7ECARD%2F73297%7ECARD%2F65587&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 607px\">",
"   <div class=\"ttl\">",
"    Intracardiac and surface ECG recordings during electrophysiologic study showing orthodromic AV reentrant tachycardia in concealed accessory pathway",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 587px; height: 421px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are three surface ECG leads (I, aVF, and V1) and intracardiac recording from the high right atrium (HRA), proximal (HBE3-4) and distal His bundle region (HBE1-2), proximal to distal coronary sinus (CS9-10, CS7-8, CS5-6, CS3-4, and CS1-2), and right ventricular apex (RVA3-4) in a patient with atrioventricular reentrant tachycardia (AVRT). During an orthodromic AVRT, there is retrograde atrial (A) activation which occurs after ventricular activation (V); the earliest atrial activation (arrow) is seen in the lateral mitral annulus (CS1-2) due to a concealed left lateral accessory pathway.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 538px\">",
"   <div class=\"ttl\">",
"    Intracardiac and surface ECG recordings during electrophysiologic study showing orthodromic AV reentrant tachycardia utilizing concealed accessory pathway during ventricular pacing",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 518px; height: 366px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are three surface ECG leads (I, aVF, and V1) and intracardiac recordings from the high right atrium (HRA), proximal (HBE3-4) and distal His bundle region (HBE1-2), proximal to distal coronary sinus (CS9-10, CS7-8, CS5-6, CS3-4, and CS1-2), right ventricular apex (RVA3-4), from a mapping catheter's distal (USER1) and proximal (USER3) electrode pairs, and a stimulus artifact (S) channel (STIM). The mapping catheter was advanced through the right femoral artery and retrograde across the aortic valve into the left ventricle. With each ventricular paced beat (V) there is retrograde conduction from the ventricle to atrium (A) via the left free wall accessory pathway. The mapping catheter has been maneuvered to the site along the mitral annulus which records the earliest atrial activity (red arrow); the atrial activity recorded at the tip electrode of USER1 precedes the earliest atrial activity (black arrow) noted in the coronary sinus (CS1-2) by 25 msec.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 565px\">",
"   <div class=\"ttl\">",
"    Intracardiac and surface ECG recordings during electrophysiologic study post-radiofrequency catheter ablation of a concealed accessory pathway",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 545px; height: 380px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are three surface ECG leads (I, aVF, v1) and intracardiac recordings from the high right atrium (HRA), proximal (HBE3-4) and distal his bundle region (HBE1- 2), proximal to distal coronary sinus (CS9-10, CS7-8, CS5-6, CS3-4, and CS1-2), the right ventricular apex (RVA3-4), recordings from a mapping catheter s distal (USER1) and proximal (USER3) electrode pairs, and a stimulus artifact channel (STIM) which shows the stimulus (S) from ventricular (V) pacing. Radiofrequency energy is applied to the site of earliest atrial activation which is near the CS1-2 electrode pair (black arrow). After a few beats, the atrial (A) activation sequences changes (*); the retrograde conduction to the atrium becomes much slower, with a change in the site of earliest atrial activation from CS1-2 to HBE3-4 (red arrow). This signifies that with ablation of the accessory pathway, retrograde atrial activation is now via the atrioventricular node. After ablation, no further SVT was inducible.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
