var title_f37_10_38060="Signs and symptoms of neutropenia";
var content_f37_10_38060=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F62992&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F62992&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Important clinical signs and symptoms of neutropenia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Indicator",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fever",
"       </td>",
"       <td>",
"        Determines need to consider immediate treatment. Periodic fever may suggest cyclic neutropenia. Recurrent fevers suggest more serious type of neutropenia, underlying autoimmune disease, or malignancy.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gingivitis*",
"       </td>",
"       <td>",
"        Often overlooked and frequently present in untreated clinically significant chronic neutropenia. Normal gingiva argues for normal marrow reserve. Gingivitis can be seen with vasculitis independent of neutropenia.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mucosal ulcers*",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        Suggests neutropenia with decreased marrow reserve, especially ulcers with no evidence of exudate. May be seen with vasculitis independent of neutropenia.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abdominal pain",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        Cramping abdominal pain or discomfort, even of a minor nature, can indicate intestinal mucosal ulcerations that can serve as a dangerous portal of entry for enteric bacteria.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abscess",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        Clear, purulent material anywhere (ear drum, pharyngeal exudate, boil, other abscess) in the presence of significant neutropenia is strong evidence for adequate marrow reserve and ability to deliver neutrophils to tissue.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Splenomegaly",
"       </td>",
"       <td>",
"        Indicates a chronic inflammatory state and suggests that neutropenia is not benign. May be the only sign of chronic inflammation in some disorders such as systemic rheumatoid arthritis or large granular lymphocyte-related neutropenia.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Erythrocyte sedimentation rate (ESR)",
"       </td>",
"       <td>",
"        Suggests deep tissue inflammation. ESR can be very helpful in the evaluation of neutropenia and monitoring severe forms of chronic neutropenia.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C-reactive protein (CRP)",
"       </td>",
"       <td>",
"        Indicates monocyte activation. CRP suggests inflammation and changes faster than the ESR. The interpretation of CRP and ESR elevation overlap but are not the same. Either can be significantly elevated when the other is normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Monocytosis",
"       </td>",
"       <td>",
"        Significant monocytosis (30 to 50 percent) is often seen with congenital neutropenia (cyclic neutropenia, Kostmann syndrome).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Past history",
"       </td>",
"       <td>",
"        Unusual or frequent major infections, chronic diarrhea, failure to thrive.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dysmorphia",
"       </td>",
"       <td>",
"        Dysmorphic features raise issue of primary marrow failure syndromes.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Note that gingivitis, oral, and mucosal ulcerations can also be seen with vasculitis in the presence or absence of neutropenia. Marrow examination in this case is the only way to infer marrow reserve status.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Symptoms and signs suggesting low marrow reserve.",
"      <br>",
"       &Delta; Symptoms and signs suggesting adequate marrow reserve.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
