var title_f37_10_38061="HTN with VEGF inhib";
var content_f37_10_38061=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F73373%7EHEME%2F63338&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F73373%7EHEME%2F63338&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommendations for initial assessment, surveillance, and management of blood pressure in patients receiving VEGF (vascular endothelial growth factor) signaling pathway inhibitors",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Pretreatment assessment and screening",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1. Standardized blood pressure measurements, preferably on two separate occasions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2. History and physical examination for formal assessment of specific cardiovascular risk factors, more detailed laboratory and/or diagnostic tests may be required to adequately screen for cardiovascular risks (eg, lipid panel, electrocardiogram)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3. Use this information to determine the appropriate intensity of monitoring and target for blood pressure control during therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4. Treat preexisting hypertension and address other comorbidities that might, through more attentive management, prolong life and support more aggressive cancer therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Monitoring during treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1. Actively monitor blood pressure throughout treatment with more frequent assessments during the first cycle (when the bulk of blood pressure elevation is expected to occur)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2. Monitoring every two to three weeks after the first cycle",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Management",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1. Patients who develop hypertension during therapy (&ge;140 mmHg/90 Hg, or increases in diastolic blood pressure &ge;20 mm from baseline) should initiate anti-hypertensive therapy, have current therapy titrated to better control blood pressure, or have another agent added. The goal for blood pressure in patients receiving VEGF inhibitors is maximum blood pressure of 140/90. Target should be adjusted lower for patients with preexisting risk factors for adverse consequences of high blood pressure (eg, diabetes, chronic kidney disease).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2. Manage blood pressure elevations aggressively to avoid complications, pay attention to agent selection, dose and scheduling of follow-up visits to control adverse effects of the antihypertensive agent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3. Consultation with a hypertension specialist may be needed if there is difficulty achieving goal blood pressure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4. Consider discontinuation or dose reduction of VEGF inhibitor therapy if diastolic blood pressure is not controlled with anti-hypertensive medication",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Modified from: Maitland ML, Bakris GL, Black HR, et al. Initial assessment, surveillance, and management of blood pressure in patients receiving vascular endothelial growth factor signaling pathway inhibitors. J Natl Cancer Inst 2010; 102:596.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Risk factors for adverse consequences of high blood pressure (BP)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Systolic BP &ge;160 mmHg or diastolic BP &ge;100 mmHg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Diabetes mellitus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Established CV disease including any history of:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ischemic stroke, cerebral hemorrhage, or transient ischemic attack",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Myocardial infarction, angina, coronary revascularization, or heart failure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Peripheral artery disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Retinal hemorrhages or exudates and papilledema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Established or subclinical renal disease including:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Microalbuminuria or proteinuria (&gt;30 mg/24 h)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Serum creatinine in men &gt;1.5 mg/dL, women &gt;1.4 mg/dL",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Calculated or estimated glomerular filtration rate &lt;60 mL/min/1.73 m",
"        <sup>",
"         2",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Subclinical organ damage previously documented by:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        ECG or echocardiogram revealing left ventricular hypertrophy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Carotid ultrasound study revealing wall thickening or plaque",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Three or more of the following CV risk factors:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Age (men &gt;55 y, women &gt;65 y)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cigarette smoking",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Dyslipidemia as measured by:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Total cholesterol &gt;190 mg/dL or",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Low-density lipoprotein cholesterol &gt;130 mg/dL or",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        High-density lipoprotein cholesterol (men &lt;40 mg/dL; women &lt;46 mg/dL) or",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Triglyceride &gt;150 mg/dL",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fasting plasma glucose &gt;100 mg/dL",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Family history of premature CV disease (first-degree male relative age &lt;55 y or first-degree female relative &lt;65 y)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Abdominal obesity male waist circumference &gt;40 in; female &gt;35 in (in persons of East Asian ancestry: male waist circumference &gt;35 in and for women &gt;31 in)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CV: cardiovascular.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Maitland ML, Bakris GL, Black HR, et al. Initial assessment, surveillance, and management of blood pressure in patients receiving vascular endothelial growth factor signaling pathway inhibitors. J Natl Cancer Inst 2010; 102:596. Copyright &copy; 2010 Oxford University Press.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
